	VALUES(@community_id, UUID(), @shi_id, '上海市',  @qu_id, '浦东新区', '张江高科技园区', '张江高科', '松涛路560号8楼', NULL, '上海张江高科技园区开发股份有限公司于1996年4月在上海证券交易所正式挂牌上市，系采用公开募集方式设立的股份制上市公司，公司简称“张江高科”，股票代码600895。上海张江高科技园区开发股份有限公司作为浦东新区直属企业和张江高科技园区开发、运营的国有控股上市公司，承担着践行深化国企改革创新发展以及张江科学城重点开发建设营运的使命。公司主营业务为张江核心园的开发建设、租赁运营和科技企业的投资。在经历了近20年的经营发展之后，公司在持续推进张江高科技园区建设发展中，不断提升在产业培育与集聚、产品设计开发、资本经营及公司内部运营管理等方面的核心能力。',NULL, NULL, NULL, NULL, NULL, NULL,NULL, 214, 1,NULL,'2',UTC_TIMESTAMP(), NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,NULL,'1', @forum_id, @feedback_forum_id, UTC_TIMESTAMP(), @eh_namespace_id);
